 key_observations = """
 * The dataset has 2031 small classes, 10 duplicated samples, 62217 nan value
 * Dataset contains DoH traffic from these resolvers AdGuard, AhaDNS, BlahDNS, BraveDNS, CloudFlare 
 * This report is generated from CloudFlare and BlahDNS selected samples.
 * The aim of generated data is to provide heterogeneous DoH traffic for various existing DoH implementations.
 * Generated dataset has bigger variability since it contains traffic from mode DoH providers usually we see lower number in real world traffic [5][]
 * This dataset is ideal for benchmarking. Real world classification with model trained on generated dataset does not provide sufficient results in most of cases [5][]
 """
